const initialState = {
    user: {},
    contents: [],
    login: false,
    token: ''
};

function reducer(state = initialState, action) {
    console.log('peine')
    switch (action.sd) {
        //add new list
        case "LOGIN":

            return {
                ...state,
                token: action.data.token,
            };
        //add task to list
        case "INIT_MAIN":
            return {
                ...state,
                contents: action.data.contents,
                user: action.data.user,

            };
        default:
            return state;
    }
}

export default reducer;
